import react from 'react-dom';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import React, { useState, useEffect, useCallback } from "react";
import './App.css';
import Main_Component from './components/Main_Component';
const [apiSort, setApiSort] = useState([])
async function apiCall() { //Gets all data from api.
    try {

        const url = 'https://mcdonalds-live-engage-api-stage-1.azurewebsites.net/stores.json';
        let response = await fetch(url);
        response = await response.json()
        setApiSort(response);
    } catch (error) {
        console.error(error);
    }
}
useEffect(() => {
    apiCall()
});

function App() {
    return ( <
        div className = "App" >

        <
        Main_Component apiSort = { apiSort } > < /Main_Component> < /
        div >
    );
}
export default App;
